/**
 * Toggle tooltip modal
 */
function openTooltip ( clickClassName, openClassName, closeClassName ) {
    clickClassName.on('click', function (e) {
        e.stopPropagation(); // prevents the document's click listener from receiving this click
        e.preventDefault(); // dont scroll
        openClassName.show();
        closeClassName[0].focus();
    });
}

function closeTooltip ( closeClassName,openClassName, clickClassName) {
    closeClassName.on('click', function () {
        openClassName.hide();
        clickClassName.focus();
    });
}

function closeDialogTooltip ( closeClassName ) {
    closeClassName.on('keydown', function (e) {
        if (e.which === 9) { // TAB or SHIFT+TAB
            e.preventDefault(); // trap focus within tooltip
        } else if (e.which === 27) {
            closeClassName[0].click();
        }
    });
}

function accessibleTooltipGeneral ( clickClassName, openClassName, closeClassName) {
    openTooltip ( clickClassName, openClassName, closeClassName );
    closeTooltip ( closeClassName, openClassName, clickClassName );
    closeDialogTooltip ( closeClassName );
}

var $accTrigger = $('.product-help-trigger');
var $accDialog = $('.product-help-dialog');
var $accDialogClose = $('.help-dialog-close');

accessibleTooltipGeneral ($accTrigger, $accDialog, $accDialogClose);

var $infoTrigger = $('.info-help-trigger');
var $infoDialog = $('.info-help-dialog');
var $infoDialogClose = $('.info-dialog-close');

accessibleTooltipGeneral ($infoTrigger, $infoDialog, $infoDialogClose);
